import React from 'react';

const CouponResult = ({ coupon }) => {
  const {
    couponTitle,
    couponCode,
    percentage,
    website,
    category,
    imageUrl,
    affiliateLink,
    createdAt,
    expiredAt,
    status,
  } = coupon;

  return (
    <div className="coupon-card">
      <img src={imageUrl} alt={couponTitle} />
      <h3>{couponTitle}</h3>
      <p>Coupon Code: {couponCode}</p>
      <p>Percentage: {percentage}% off</p>
      <p>Website: {website}</p>
      <p>Category: {category}</p>
      <p>Created At: {createdAt}</p>
      <p>Expires At: {expiredAt}</p>
      <p>Status: {status}</p>
      <a href={affiliateLink} target="_blank" rel="noopener noreferrer">
        Get Deal
      </a>
    </div>
  );
};

export default CouponResult;
